# Fast funcions (out of the class)

@njit
def compute_Kgp(PdF, dNdx):
    Kgp = np.zeros((8,3,8,3))
    for i in range(3):
        for j in range(3):
            for m1 in range(8):
                for m2 in range(8):
                    for k in range(3):
                        for l in range(3):
                            # Kgp[m1, i, m2, j] += PdF[i,k,j,l] * dNdx[m1, k] * dNdx[m2, l]
                            Kgp[m1, i, m2, j] += PdF[k,i,j,l] * dNdx[m1, k] * dNdx[m2, l]
    return Kgp





