        dNd_xi = 1/8*np.array([ [-(1-g2)*(1-g3) , -(1-g1)*(1-g3) , -(1-g1)*(1-g2) ],
                                [ (1-g2)*(1-g3) , -(1+g1)*(1-g3) , -(1+g1)*(1-g2) ],
                                [ (1+g2)*(1-g3) ,  (1+g1)*(1-g3) , -(1+g1)*(1+g2) ],
                                [-(1+g2)*(1-g3) ,  (1-g1)*(1-g3) , -(1-g1)*(1+g2) ],
                                [-(1-g2)*(1+g3) , -(1-g1)*(1+g3) ,  (1-g1)*(1-g2) ],
                                [ (1-g2)*(1+g3) , -(1+g1)*(1+g3) ,  (1+g1)*(1-g2) ],
                                [ (1+g2)*(1+g3) ,  (1+g1)*(1+g3) ,  (1+g1)*(1+g2) ],
                                [-(1+g2)*(1+g3) ,  (1-g1)*(1+g3) ,  (1-g1)*(1+g2) ]])
        
        Fp = FPconv_el[i_g]
        epcum = epcum_el[i_g]

        J = np.dot(dNd_xi.T,X)
        invJ = np.linalg.inv(J)
        detJ = np.linalg.det(J)

        dNdx = np.dot( dNd_xi , invJ.T )


        depcum = 0
        cur_time = 0
        delta_time = 1

        counter2 = 0

        while cur_time<1 and delta_time>1/maxBisect:
            counter2 += 1

            cur_time += delta_time
            F = np.eye(len(dNdx.T)) + np.dot(dNdx.T,u_ref+(u-u_ref)*cur_time).T
            Fe = F@np.linalg.inv(Fp)
            detFe = np.linalg.det(Fe)

            if detFe < 1e-12 or np.isnan(detFe):
                cur_time -= delta_time
                delta_time /= 2     
                continue

            Fe_invc = np.linalg.inv(Fe).T

            P = 2*c10*(Fe-Fe_invc) + 2*d1*Fe_invc*np.log(detFe)

            Mdev = Fe.T@P - np.trace(Fe.T@P)/3*np.eye(3)

            yieldfunction=sqrt(1.5*(Mdev[0,0]**2+Mdev[1,1]**2+Mdev[2,2]**2+2*Mdev[0,1]**2+2*Mdev[0,2]**2+2*Mdev[1,2]**2))-My0-Hardening_modulus*(epcum+depcum)**Hardening_exponent

            if yieldfunction < 0:
                depcum_last = 0
                Fp_temp = Fp.copy()

