                depcum_last = 1e-8
                dyieldfunctiondM=1.5*Mdev/sqrt(1.5*(Mdev[0,0]**2+Mdev[1,1]**2+Mdev[2,2]**2+2*Mdev[0,1]**2+2*Mdev[0,2]**2+2*Mdev[1,2]**2))
